import React from "react";
import PictureCard from "./picturecard";
import friends from "./friends.json";

function Cardgroup() {
  const pictureCards = friends.map(friend => <PictureCard
    name={friend.name}
    image={friend.image}
    handleClick={props.clicked}
  />);
  return (
    <div>
      {pictureCards}
    </div >
  );
}

export default Cardgroup;
